  JWILLIAMS, . Michael George Mackie and JACKSON, Margaret Hughlings
  JWILLIAMS, Cathrin Mackie and THOMAS, Paul Litster
  02> WILLIAMS, Cathrin Mackie m on 16.07.1964 to THOMAS, Paul Litster
  b 31.01.1939
  b 29.09.1938
  Cathrin b. at Gisborne and m. at Wairoa. Paul, s/o Donald Victor Thomas and Jean Agnes Robertshaw, b.
  at Wairoa. Address: "Tuhara", PO Box 123, Wairoa.
  Cathrin was educated at Queenswood School, Hastings, and Nga Tawa School, Marton, and qualified in
  Wellington as a Karitane nurse. She has travelled extensively.
  Paul was educated at Hereworth School and Christ's College. After military training he worked for four
  years on farms in the North and South Islands then travelled to Australia and Europe before returning
  home to manage Tuhara, the family farm. He briefly took on the management of Te Puna Station near
  Wairoa, just prior to his marriage, and he and Cathrin spent the first year of their married life
  there. In 1965 they bought a small farm next to Tuhara and moved there whilst also leasing Tuhara. In
  1968 they bought Tuhara from the estate of J A Thomas and have continued to live there since. Paul
  also supervises Mangatawhiti Station for the family, and is a company director.
  Refer to "The Descendants of John and Marion Thomas" published by Evagean Publishing in 1996 for
  details of Paul's family.
  01> THOMAS, Andrew Henry Walter
  b 18.11.1965
  Andrew b, at Wairoa. Address: Tuhara, PO Box 123, Wairoa.
  Andrew was educated at Hereworth School in Havelock North and Rathkeale College in Masterton and
  graduated BAgCom from Lincoln University. Since then he has been involved in the field of rural
  finance, with the exception of two years spent travelling overseas. He is currently working for
  Westpac Banking Corporation as an Agribusiness Manager in Gisborne.
  U2 THOMAS, Michael William m on 06.02.1993 to TOWNSEND. Roslyn Diana
  Donald
  b 16.12.1966
  b 17.12.1968
  Michael b. at Wairoa and m. at Auckland. Roslyn, d/o James Slater and Diana Margaret Townsend, b.
  at Auckland. Address: Tuhara, RD 6, Wairoa.
  Michael was educated at Hereworth School in Havelock North, Rathkeale College in Masterton and
  graduated DipAg and Dip Farm Management from Lincoln College. He then travelled overseas for two
  years and since his return home he has pursued a career in farming.
  Roslyn boarded at Diocesan School for Girls in Auckland then graduated DipHort from Lincoln
  College. She then travelled extensively for two years.
