  b 24.02.1898 d 27.03.1986
  Nancy b. at Fitzherbert Street, Gisborne and m. at Holy Trinity Anglican Church, Gisborne.
  Anthony, s/o William Charles Caccia-Birch and Maud Keiller (of "Erewhon" station, Hawkes Bay
  and later of "Woodhey" (now Caccia-Birch House, Palmerston North) b. at Mangatoro, near
  Dannevirke, and d. at Gisborne. Both Nancy and Tony were cremated and ashes interred in the
  family plot at Kelvin Grove, Ashhurst.
  Nancy was educated at Chilton St James School, Wellington, later being involved with the
  Girl Guides in Gisborne. Following their marriage she and Tony lived at "Thoresby" farm, Marton, and later
